import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <footer className="color-foot">
      <Container>
        <Row>
            <Col className="text-center py-3">Made by Maxim Kreerenko</Col>
            <Col className="text-left py-3"><h1 className="title-navbar">NutriNation</h1></Col>
        </Row>
      </Container>
    </footer>
  );
}

export default Footer;
